import React from "react"
import Logo from './Logo'
import MenuContainer from './MenuContainer'
import './App.css';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fab } from '@fortawesome/free-brands-svg-icons'

library.add(fab)

function App() {
  return (
    <>
      <MenuContainer />
      <Logo />
    </>
  );
}

export default App;
